#include <vector>
using namespace std;

class Solution {
public:
    vector<vector<int>> constructProductMatrix(vector<vector<int>>& grid) {
        int n = grid.size(), m = grid[0].size();
        vector<vector<int>> result(n, vector<int>(m, 1));
        vector<int> rowProducts(n, 1), colProducts(m, 1);

        // Calculate the product of all elements
        int totalProduct = 1;
        bool hasZero = false; // To check if there's any zero in the grid
        for (int i = 0; i < n; ++i) {
            for (int j = 0; j < m; ++j) {
                if (grid[i][j] != 0) {
                    totalProduct = (totalProduct * grid[i][j]) % 12345;
                } else {
                    hasZero = true;
                }
            }
        }

        // If there's a zero in the grid, totalProduct should be handled differently
        if (hasZero) {
            // Handle cases with zero differently as the product will be zero
            // except for the position which had the original zero
            for (int i = 0; i < n; ++i) {
                for (int j = 0; j < m; ++j) {
                    result[i][j] = 0; // Since there's at least one zero, most products will be zero
                    if (grid[i][j] == 0) {
                        // Calculate product for the zero position
                        int product = 1;
                        for (int x = 0; x < n; ++x) {
                            for (int y = 0; y < m; ++y) {
                                if (x != i || y != j) {
                                    product = (product * grid[x][y]) % 12345;
                                }
                            }
                        }
                        result[i][j] = product;
                    }
                }
            }
        } else {
            // If no zero, calculate normally as initially intended
            for (int i = 0; i < n; ++i) {
                for (int j = 0; j < m; ++j) {
                    int excludeCurrent = totalProduct;
                    if (grid[i][j] != 0) {
                        // Ideally, we'd divide totalProduct by grid[i][j] here,
                        // but direct division isn't feasible with modulo.
                        // A different strategy is needed.
                    }
                    result[i][j] = excludeCurrent;
                }
            }
        }

        return result;
    }
};
